const METADATA = {
    website: "https://github.com/aimc6594/Shapez-and-Mods",
    author: "aimc6594",
    name: "Textura oscura para las cintas transportadoras",
    version: "1",
    id: "dark-belts", // Identificador único del mod / Unique mod identifier
    description: "Reemplaza los sprites de las cintas transportadoras y sus animaciones. / Replaces the sprites of conveyor belts and their animations.",
    minimumGameVersion: ">=1.5.0",
    doesNotAffectSavegame: true, // No afecta las partidas guardadas / Does not affect savegames
};

// Clase principal del mod / Main mod class
class Mod extends shapez.Mod {
    init() {
        // Registrar los sprites principales de la cinta transportadora
        // Estos reemplazan los sprites originales en el juego / Overwrites the original game sprites
        this.modInterface.registerSprite("sprites/buildings/belt_top.png", RESOURCES["belt_top.png"]);
        this.modInterface.registerSprite("sprites/buildings/belt_left.png", RESOURCES["belt_left.png"]);
        this.modInterface.registerSprite("sprites/buildings/belt_right.png", RESOURCES["belt_right.png"]);

        // Ejemplo de animación dinámica / Dynamic animation example
        // No se registran sprites nuevos, se usan los sprites principales
        const directions = ["forward", "left", "right"];
        directions.forEach(direction => {
            for (let i = 0; i <= 13; i++) {
                const spriteName = `${direction}_${i}.png`;
                const spritePath = `sprites/belt/built/${spriteName}`;
                // Aquí se "llaman" los sprites principales para crear la animación
                this.modInterface.registerSprite(spritePath, RESOURCES[spriteName]);
            }
        });
    }
}


